import React, { Component } from 'react'

class Chart extends Component {

  componentDidMount() {
    console.log("Mounting Chart Component...")
    this.drawChart();
  }

  drawChart() {
    console.log("Drawing chart...")
  }

  render() {
    return <div id={"#" + this.props.id}></div>
  }

}

export default Chart
